function ProfileTable(){
    return(
        <>
        <div className="tableOfProfiles">
            <table>
                <td>
                    <th>Username</th>
                    <th>Register Date</th>
                    <th>Status</th>
                    <th></th>
                </td>
            </table>
        </div>
        </>
    );
}

export default ProfileTable;
